import React, { Component } from 'react'

class PostTable extends Component {
    render() {
        return(
            <table>
                <tr>Post ID</tr>
                <tr>Text</tr>
                <tr>Clicks</tr>
                <tr>Impressions</tr>
                <tr>Currency</tr>
        </table>
    )
  }
}

export default PostTable
